import React from 'react'
import { Card } from 'react-bootstrap'
import { homeListReducer } from '../reducers/homeReducers'
import { Link } from 'react-router-dom'

function Home({ home }) {


    return (
        <Card className='my-3 p-3 rounded'>
            <a href={`api/v1/homes/${home._id}`}>
            {/* {home.photos.map(photo => (
                <Card.Img src={photo.image}variant='top' />
            ))} */}
            </a>
            <Card.Body>
                <Link to={`api/v1/homes/${home.id}`}>
                    <Card.Title as='div'><strong>{home.location}</strong></Card.Title>
                </Link>
                <Card.Text>{home.description}</Card.Text>
                <Card.Text as='h3'>${home.daily_price}</Card.Text><h6>/night</h6>
            </Card.Body>
        </Card>
    )
}

export default Home;
